          name: 'Album 1',
          artist: 'Artist 1',
        },
        {
          coverImageUrl: 'https://upload.wikimedia.org/wikipedia/en/5/51/Igor_-_Tyler%2C_the_Creator.jpg',
          name: 'Album 2',
          artist: 'Artist 2',
        },
        {
            coverImageUrl: 'https://upload.wikimedia.org/wikipedia/en/5/51/Igor_-_Tyler%2C_the_Creator.jpg',
            name: 'Album 2',
